import React from "react";

class ProductList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return ( <
            React.Fragment >
            <
            h1 className = "head " > Product - List < /h1>  <
            section className = "p-3" >
            <
            div class = "container" >
            <
            div class = "row" >
            <
            div class = "col-md-4" >
            <
            div class = "card" >

            <
            div class = "card-body" >
            <
            p class = "card-ProductName" > Product Name < /p> <
            p class = "card-Sno" > Serial Number: Sno123 < /p> <
            p class = "card-Qty" > Quantity: 5 < /p> <
            p class = "card-Total" > Total: $50 .00 < /p> < /
            div > <
            /div> < /
            div > <
            /div> < /
            div >
            <
            /section> < /
            React.Fragment >
        );
    }
}

export default ProductList;
